:"display_data"}],"source":["## Recoding the locations\n","McSentimentLocation$truncated_address <- sapply(strsplit(McSentimentLocation$store_address, \",\"), function(x) paste(x[1], x[2], sep = \",\"))\n","\n","## Getting a location wise color palette\n","color_palette <- rainbow(length(unique(McSentimentLocation$truncated_address)))\n","                                                \n","## Truncating the location address upto second comma\n","McSentimentLocation$location_code <- as.numeric(factor(McSentimentLocation$truncated_address))\n","\n","## Create a mapping of numeric codes to location names\n","code_location_mapping <- unique(McSentimentLocation[c(\"location_code\", \"truncated_address\")])\n","\n","## Combined location code and truncated address\n","code_location_mapping$combined_label <- paste(code_location_mapping$location_code, code_location_mapping$truncated_address, sep = \" - \")\n","                                                \n","# Plotting the stacked bar graph with numeric codes and location names in the legend\n","LocationSentiment <- ggplot(McSentimentLocation, aes(x = as.factor(location_code), y = score, fill = as.factor(location_code))) +\n","  geom_bar(stat = \"identity\", position = \"stack\", color = \"black\") +\n","  scale_fill_manual(values = rainbow(length(unique(McSentimentLocation$truncated_address))),\n","                    breaks = unique(McSentimentLocation$location_code),\n","                    labels = code_location_mapping$combined_label) +\n","  theme_minimal() +\n","  labs(title = \"Sentiment Scores for McDonald's Store Locations (US)\",\n","       x = \"Location Code\",  # Modify x-axis label\n","       y = \"Sentiment Score\") +\n","  theme(axis.text.x = element_text(angle = 60, hjust = 1),\n","        axis.title.x = element_text(size = 10))\n","\n","LocationSentiment\n","ggsave(\"LocationSentiment.png\", plot = LocationSentiment)  \n"]},{"cell_type":"markdown","id":"f80039f9","metadata":{"papermill":{"duration":0.028111,"end_time":"2023-12-26T22:24:47.837822","exception":false,"start_time":"2023-12-26T22:24:47.809711","status":"completed"},"tags":[]},"source":["# 8 - Plotting the sentiment scores in the map"]},{"cell_type":"code","execution_count":17,"id":"d73a5ca8","metadata":{"execution":{"iopub.execute_input":"2023-12-26T22:24:47.895445Z","iopub.status.busy":"2023-12-26T22:24:47.893211Z","iopub.status.idle":"2023-12-26T22:24:48.900987Z","shell.execute_reply":"2023-12-26T22:24:48.898438Z"},"papermill":{"duration":1.040068,"end_time":"2023-12-26T22:24:48.903876","exception":false,"start_time":"2023-12-26T22:24:47.863808","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2ATZR8H8N/dZSdtk+5FW0pLJy1QNshQRBBFHCAoLlRcuBXBgYoTQdw40deN\nCgIKbhQRlb1KoYO2dNDS0p00acbdvX8ESu1IV0Lh+H7+ai6XZ6Vpv7l77jlGFEUCAAAAgLMf\n29MNAAAAAAD3QLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJ\nQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgE\nOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLAD\nAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAA\nAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAA\nkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJ\nQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgE\nOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLAD\nAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAA\nAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAA\nkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJ\nQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgE\nOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLAD\nAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAA\nAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAgEOwAAAACJQLADAAAAkAg